def wrap_angle(angle):
    return (angle + ( 2.0 * np.pi * np.floor( ( np.pi - angle ) / ( 2.0 * np.pi ) ) ) )

class StateValidityChecker:
    """ Checks if a position or a path is valid given an occupancy map."""

    # Constructor
    def __init__(self, distance=0.1, is_unknown_valid=True):
        # map: 2D array of integers which categorizes world occupancy
        self.map = None 
        # map sampling resolution (size of a cell))                            
        self.resolution = None
        # world position of cell (0, 0) in self.map                      
        self.origin = None
        # set method has been called                          
        self.there_is_map = False
        # radius arround the robot used to check occupancy of a given position                 
        self.distance = distance                    
        # if True, unknown space is considered valid
        self.is_unknown_valid = is_unknown_valid    
    
    # Set occupancy map, its resolution and origin. 
    def set(self, data, resolution, origin):
        self.map = data
        self.resolution = resolution
        self.origin = np.array(origin)
        self.there_is_map = True
    
    # Given a pose, returs true if the pose is not in collision and false othewise.
    def is_valid(self, pose): 
        #print(f"Checking validity of pose: {pose}")
        # TODO: convert world robot position to map coordinates using method __position_to_map__
        # TODO: check occupancy of the vicinity of a robot position (indicated by self.distance atribute). 
        # Return True if free, False if occupied and self.is_unknown_valid if unknown. 
        # If checked position is outside the map bounds consider it as unknown.
        shape = [len(self.map), len(self.map[0])]

        # If pose is in world coordinates
        if isinstance(pose[0], float) or isinstance(pose[1], float):
            # Convert to map coordinates
            pose = self.__position_to_map__(pose)
            row = pose[0]
            col = pose[1]
        else:
            row, col = pose

        # If pose out of bounds, return false
        if row < 0 or row >= shape[0] or col < 0 or col >= shape[1]:
            return False 

        distance = round(self.distance / self.resolution)

        i_min, i_max = max(0, row - distance), min(shape[0] - 1, row + distance)
        j_min, j_max = max(0, col - distance), min(shape[1] - 1, col + distance)

        # Check if region is valid
        for i in range(i_min, i_max + 1):
            for j in range(j_min, j_max + 1):
                if 0 <= i < shape[0] and 0 <= j < shape[1]:  # Ensure inside map bounds
                    cell_value = self.map[i, j]
                    if cell_value == 100: # Collision detected
                        return False  
                    if cell_value == -1 and not self.is_unknown_valid:  # Unknown
                        return False
                    
        return True


    # Given a path, returns true if the path is not in collision and false othewise.
    def check_path(self, path):

        # TODO: Discretize the positions between 2 waypoints with an step_size = 2*self.distance
        for i in range(len(path) - 1):
            spaced_x = np.linspace(path[i][0], path[i+1][0]) # Edit so it is spaced with step_size
            spaced_y = np.linspace(path[i][1], path[i+1][1])
            for j in range(len(spaced_x)):
                spaced_p = [spaced_x[j], spaced_y[j]]
                # TODO: for each point check if `is_valid``. If only one element is not valid return False, otherwise True.
                if not self.is_valid(spaced_p):
                    return False 
        
        return True

    # Transform position with respect the map origin to cell coordinates
    def __position_to_map__(self, p):

        # TODO: convert world position to map coordinates. 
        shape = [len(self.map), len(self.map[0])]
        row = int((p[0] - self.origin[0]) / self.resolution)
        col = int((p[1] - self.origin[1]) / self.resolution)
        if 0 <= row < shape[0] and 0 <= col < shape[1]:
            return row, col
        else:
            return None
    
# Define Planner class (you can take code from Autonopmous Systems course!)
class Planner:
    def __init__(self, state_validity_checker, max_iterations=10000, dominion=[-10.0, 10.0, -10.0, 10.0], delta_q=1, goal_bias=0.1):
        self.state_validity_checker = state_validity_checker
        self.max_iterations = max_iterations
        map_width = 98
        map_height = 99
        self.dominion = dominion    # Boundaries
        self.delta_q = delta_q
        self.goal_bias = goal_bias

    def compute_path(self, q_start, q_goal):
        G = {
            "vertices": [q_start],  # Initialize the graph with the starting point and empty edge list
            "edges": []
        }
        min_dist = 0.1                # Set minimum distance to consider goal reached

        for k in range(self.max_iterations):
            q_rand = self.rand_config(q_goal)
            q_near = self.nearest_vertex(q_rand, G)
            q_new = self.new_config(q_near, q_rand)

            if self.is_segment_free_inc(q_near, q_new):              # Check if the path from q_near to q_new is collision-free
                self.add_vertex(G, q_new)                            # Add the new configuration to the graph
                self.add_edge(G, q_near, q_new)                      # Connect the nearest vertex to the new configuration
                if self.dist(q_new, q_goal) < min_dist:              # Check if the new configuration is close enough to the goal
                    self.add_edge(G, q_new, q_goal)                  # If yes, connect the new configuration directly to the goal
                    return self.reconstruct_path(G, q_start, q_goal) # Generate the path from start to goal
        
        print("No path found.")
        return None     # No path is found within the iterations

    def smooth_path(self, path):
        n = len(path)
        smoothed_path = [path[0]]
        i = 0
        j = n - 1

        while i < n-1:  # Stop when we reach the goal
            j = n-1   # Set j to the goal node

            # Find the farthest node j that can be connected to i
            while j > i and not self.is_segment_free_inc(path[i], path[j]):
                j = j-1

            # Add the farthest reachable node to the smoothed path
            smoothed_path.append(path[j])
            i = j  # Move to the next segment

        return smoothed_path

    def rand_config(self, q_goal):
        # Return goal with probability p, otherwise sample random point
        if np.random.rand() < self.goal_bias:
            print(f"Random sample is goal: {q_goal}")
            return q_goal
        else:
            # Generate random coordinates within the map bounds
            x = np.random.uniform(self.dominion[0], self.dominion[1])
            y = np.random.uniform(self.dominion[2], self.dominion[3])
            print(f"Random sample is: ({x:.2f}, {y:.2f})")
            return (x, y)

    def nearest_vertex(self, q_rand, G):
        # Find the vertex in G closest to q_rand
        vertices = G["vertices"]
        smallest_distance = float('inf')
        nearest_vertex = None
        # For each vertex in the graph
        for vertex in vertices:
            distance = self.dist(q_rand, vertex) # Calculate the distance from q_rand to the current vertex
            if distance < smallest_distance: # Is distance smaller than the smallest distance found so far
                smallest_distance = distance # Update the smallest distance
                nearest_vertex = vertex   #Update the nearest vertex
    
        return nearest_vertex

    def new_config(self, q_near, q_rand):
        # Move from q_near towards q_rand by delta_q
        delta_x = q_rand[0] - q_near[0]
        delta_y = q_rand[1] - q_near[1]
        distance = self.dist(q_near, q_rand) # Calculate the distance between q_near and q_rand
        if distance == 0: # If it is zero, return q_near
            return q_near
        # Normalize the direction vector 
        direction = [delta_x / distance, delta_y / distance]
        move_x = direction[0] * self.delta_q
        move_y = direction[1] * self.delta_q
        new_x = round(q_near[0] + move_x)
        new_y = round(q_near[1] + move_y)
        q_new = (new_x, new_y)
        # Check if the new point overshoots the target
        if self.dist(q_near, q_new) > distance:  # If yes, set q_new to be the same as q_rand
            q_new = q_rand
        return q_new

    def is_segment_free_inc(self, q_near, q_new):
        # Check if segment between q_near and q_new is free from obstacles
        num_samples = int(max(abs(q_new[0] - q_near[0]), abs(q_new[1] - q_near[1])) + 1)
        # Generate evenly spaced coordinates between q_near and q_new
        x_coords = np.linspace(q_near[0], q_new[0], num_samples).astype(int)
        y_coords = np.linspace(q_near[1], q_new[1], num_samples).astype(int)
        for x, y in zip(x_coords, y_coords):
            if not self.state_validity_checker.is_valid([x, y]): # Is the current point valid
                print(f"Blocked at: ({x}, {y})")
                return False
            
        return True # All points are valid

    def add_vertex(self, G, vertex):
        # Append the new vertex to the graph's vertex list
        G["vertices"].append(vertex)

    def add_edge(self, G, vertex_1, vertex_2):
        # Append the new edge to the graph's edge list
        G["edges"].append((vertex_1, vertex_2))

    def reconstruct_path(self, G, q_start, q_goal):
        path = [q_goal]
        current = q_goal
        while not np.array_equal(current, q_start):
            for vertex_1, vertex_2 in G["edges"]:
                if np.array_equal(vertex_2, current):
                    path.append(vertex_1)
                    current = vertex_1
                    break
        return path[::-1]

    def dist(self, p1, p2):
        return np.sqrt((p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2)


# Planner: This function has to plan a path from start_p to goal_p. To check if a position is valid the 
# StateValidityChecker class has to be used. The planning dominion must be specified as well as the maximum planning time.
# The planner returns a path that is a list of poses ([x, y]).
def compute_path(start_p, goal_p, state_validity_checker, max_iterations=1000):
    # TODO: Plan a path from start_p to goal_p inside dominiont using a Planner Object and the 
    # StateValidityChecker Object previously defined.
    # TODO: if solved, return a list with the [x, y] points in the solution path.
    # example: [[x1, y1], [x2, y2], ...]
    # TODO: Ensure that the path brings the robot to the goal (with a small tolerance)!
    origin = state_validity_checker.origin
    resolution = state_validity_checker.resolution
    height, width = state_validity_checker.map.shape
    planner = Planner(state_validity_checker, max_iterations, dominion=[origin[0], origin[0] + width * resolution, origin[1], origin[1] + height * resolution], delta_q=1, goal_bias=0.1)
    path = planner.compute_path(start_p, goal_p)
    if path:
        result = []
        for p in path:
            result.append([p[0], p[1]])
        return result
    return None


# Controller: Given the current position and the goal position, this function computes the desired 
# lineal velocity and angular velocity to be applied in order to reah the goal.
def move_to_point(current, goal, Kv=0.5, Kw=0.5):
    
    # TODO: Use a proportional controller which sets a velocity command to move from current position to goal (u = Ke)
    # To avoid strange curves, first correct the orientation and then the distance. 
    # Hint: use wrap_angle function to maintain yaw in [-pi, pi]
    # This function should return only linear velocity (v) and angular velocity (w)
    delta_x = goal[0] - current[0]
    delta_y = goal[1] - current[1]
    distance = np.sqrt(delta_x**2 + delta_y**2)
    desired_angle = np.arctan2(delta_y, delta_x)
    current_angle = wrap_angle(current[2])
    angle_err = wrap_angle(desired_angle - current_angle)
    w = -Kw * angle_err      # Angular velocity
    if abs(angle_err) < np.pi / 6:
        v = Kv * distance   # Only move when angle error is small
    else:
        v = 0
    return v, w


